class Solution {

    /**
     * @param Integer[] $nums
     * @param Integer $x
     * @return Integer
     */
    function maxScore($nums, $x) {
        $total = array_sum($nums);
        $n = count($nums);
        $minMoveSum = PHP_INT_MAX;
        $currentSum = 0;
        $left = 0;

        for ($right = 0; $right < $n; $right++) {
            $currentSum += $nums[$right];
            while ($currentSum - $total + $x > 0 && $left <= $right) {
                $currentSum -= $nums[$left++];
            }
            if ($currentSum - $total + $x == 0) {
                $minMoveSum = min($minMoveSum, $left + $n - 1 - $right);
            }
        }

        return $minMoveSum == PHP_INT_MAX ? -1 : $n - $minMoveSum;
    }
}
